import React, { Component } from 'react';
import {Link} from "react-router-dom";

export default class Upload extends Component {

  render() {
    let stats= this.props.data;
    console.log(stats.spotify);
    console.log(this.props.submitform);
    // console.log(stats.spotify.items[0].external_urls.id);
    return (
    <div className="upload">
        <form  onSubmit={this.props.submitform} className="comments__form" id = "comment-form" action="" >
            <input type="text" name="comment" placeholder="Enter the image address"/>
            <div className="comments__form--button">
                <button className="cancel" type="reset">CANCEL</button>
                <button type="submit">SUBMIT</button>
            </div>
            <div className="picture">
            </div>
        </form>
        <iframe src="https://open.spotify.com/embed/user/spotify/playlist/37i9dQZF1DXdPec7aLTmlC" width="700" height="680" frameborder="1" allowtransparency="true"></iframe> 
        {/* <img src={this.props.imgdisplay}> </img> */}
    </div>
    )
  }
}
